import React from "react";
import { Nav, Image } from "react-bootstrap";
import './sidebar.css';

const Sidebar = () => {
  return (
    <Nav className="sidebar flex-column d-none d-md-block">
      <div className="image-container">
        <Image
          src="HEALPH.png" 
          alt="Sidebar Logo"
          fluid
        />
      </div>
    
      <Nav.Item>
        <Nav.Link href="#">Dashboard</Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link href="#">Daily Intakes</Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link href="#">Meal Viewer</Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link href="#">Settings</Nav.Link>
      </Nav.Item>

    </Nav>
  );
};

export default Sidebar;
